import React from "react";
/* Vendor CSS Module */
import "bootstrap/dist/css/bootstrap.min.css";
/* Vendor JS Module */
import "bootstrap/dist/js/bootstrap.bundle.min.js";
/* Vanilla CSS File */
import "./Body.css";
/* Importing JSON File */
import characters from "../assets/characters.json";

const Body = () => {
  return (
    <div className="container pokemon-character-display">
      {characters.map((pokemon: any, index: number) => (
        <div key={pokemon.id}></div>
      ))}
    </div>
  );
};

export default Body;
